INSERT INTO `blogs` VALUES (336, '习近平主席赴俄罗斯出席第四届东方经济论坛取得圆满成功', '<p><strong>　央视网消息</strong>（新闻联播）：9月11日至12日，国家主席习近平应邀赴俄罗斯出席第四届东方经济论坛。习近平主席此访高举和平、发展、合作、共赢旗帜，为中俄关系增添新动力，为区域合作开辟新前景，为国际关系注入新气象。值此世界政治经济形势错综复杂的多事之秋，中国特色大国外交再次显示旺盛的生命力，释放强劲的正能量，展现宽广的大格局。</p><p>　　9月以来，中国外交高潮迭起、精彩纷呈。中非合作论坛北京峰会刚刚落下帷幕，习近平主席旋即赴俄罗斯出席东方经济论坛，同普京总统共同引领新时代中俄关系发展，同东北亚各方共商区域和平与发展大计。</p><p><img src=\"http://p1.img.cctvpic.com/photoworkspace/contentimg/2018/09/13/2018091319592611834.jpg\" alt=\"1\" width=\"500\"></p><p>　　此访是习近平主席首次出席东方经济论坛，延续了中俄相互支持对方举办大型活动的传统，受到普京总统盛情接待。是一次深化互信之行、增进友谊之行、拓展合作之行、推动共赢之行。两国元首在亲密友好的氛围中大范围、小范围、一对一地长时间沟通交流，对中俄全面战略协作伙伴关系进一步发展作出部署，就重大国际和地区问题进行对表。双方同意保持战略定力，密切战略协作，捍卫中俄两国自身和国际社会共同利益。双方将继续同国际社会一道，推动各种热点问题的政治解决进程，共同反对单边主义和贸易保护主义，秉持人类命运共同体理念，推进构建新型国际关系。这一系列共识充分表明，中俄密切关系是双方的战略决断和长远选择，树立了大国、邻国关系典范。</p><p>　　习近平主席和普京总统专门抽出时间出席两国友好交流活动，成为此访一大亮点。今年适逢中国四川汶川地震灾区儿童赴俄疗养10周年。中俄元首共同接见曾在“海洋”全俄儿童中心结下深厚情谊的两国青少年代表，勉励两国青少年做国家栋梁和友谊使者，让中俄世代友好的事业薪火相传、生生不息。习近平主席邀请“海洋”中心师生来华做客，续写两国友好交往新的佳话。习近平主席应普京总统邀请出席“远东杯”国际帆船拉力赛颁奖仪式，支持中俄加强体育人文交流。习近平主席强调，要推动中俄地方人文交流机制化、常态化，加深对彼此文化传统的了解和认知。</p><p><img src=\"http://p1.img.cctvpic.com/photoworkspace/contentimg/2018/09/13/2018091319593052606.jpg\" alt=\"1\" width=\"500\"></p><p>　　此访期间，习近平主席同普京总统规划下阶段两国务实合作方向，商定继续深入开展共建“一带一路”和欧亚经济联盟对接，重点加强能源、农业、科技创新、金融等领域合作，稳步推进战略性大项目，积极打造合作新增长点。习近平主席邀请普京总统明年来华出席第二届“一带一路”国际合作高峰论坛，普京总统当场欣然接受。两国元首共同参观中俄经贸合作图片展，并见证签署一系列双边合作文件，昭示着双方广阔的合作空间。两国元首共同出席中俄地方领导人对话会，还一道在远东风采街参观考察。习近平主席强调，要借助今明两年中俄地方合作交流年的东风，开启两国地方合作新时代。</p><p>　　东方经济论坛是东北亚各国凝聚智慧、共商合作的重要契机。习近平主席在论坛全会上致辞时提出四点主张：要增进互信，维护地区和平安宁；要深化合作，实现各国互利共赢；要互学互鉴，巩固人民传统友谊；要着眼长远，实现综合协调发展。这些重要主张为开创东北亚地区美好未来描绘了清晰可行的路线图，得到与会各方支持响应。</p><p><img src=\"http://p1.img.cctvpic.com/photoworkspace/contentimg/2018/09/13/2018091319593147259.jpg\" alt=\"1\" width=\"500\"></p><p>　　出席论坛期间，习近平主席还同与会国家领导人进行友好交流，加深互信合作。在会见蒙古国总统巴特图勒嘎时，双方同意把握好中蒙关系正确方向，以实际行动维护好政治基础，大力推动“一带一路”同“发展之路”对接。习近平主席同日本首相安倍晋三举行双边会晤，指出中日关系正步入正常轨道。双方要巩固政治基础，把握正确方向，增进相互理解，扩大共同利益，建设性管控分歧，开展良性互动。安倍首相表示，日方改善和发展对华关系的愿望是真诚的，决心为此作出努力，推动两国关系取得新的更大发展。</p><p>　　习近平主席此访是一次务实精准高效的“点穴式”访问，有利于大国关系的良性互动，有利于周边外交的深耕细作，是我国打造周边和人类命运共同体的重要实践，体现了大国领袖宽广宏大的国际视野、自信从容的格局风范。</p>', '2018-09-14 07:54:48', '2018-09-14 07:54:48', 0, 1, 1, 0);
